import React from 'react';
import './App.css';
import Certifications from './components/certifications';
import './app.scss';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Testing</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <Certifications />
    </div>
  );
}

export default App;
